import { BrowserRouter, Route, Routes } from 'react-router-dom';
import { ROUTE_TYPES } from './common/routeType';
import { Menu } from './components/menu';

function AppRouts() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path={ROUTE_TYPES.SLASH} element={<Menu />}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export { AppRouts };
